import React from 'react';
import '../../KrunkySite.css';
import ReactPlayer from "react-player/twitch";

export const StreamPanel = () => {
    return (
        <>
            <div className="stream-wrapper">
                <ReactPlayer url="https://www.twitch.tv/krunkyxo"/>
            </div>
        </>
    );
}
